			Acc, _, F2, F3, TrUserData) ->
    ZValue = X bsl N + Acc,
    NewFValue = if ZValue band 1 =:= 0 -> ZValue bsr 1;
		   true -> -(ZValue + 1 bsr 1)
		end,
    dfp_read_field_def_rsp_join(Rest, 0, 0, NewFValue, F2,
				F3, TrUserData).


